import React from 'react'
import styles from '../c_iphone-14-1.module.css'
import bg from '../assets/bg.jpg' //gambar
import fontstyle from '../assets/fontstyle.png' //1
import rectangle1 from '../assets/rectangle1.png' //2
import rectangle2 from '../assets/rectangle2.png' //3

// import gambar from '../assets/112.jpg' //gambar
// import gambar1 from '../assets/group1.png' //1
// import gambar2 from '../assets/rectangle1.png' //2
// import gambar3 from '../assets/rectangle2.png' //3

export const Iphone = () => {
  return (
    <div className="iphone">
      <div className="overlap-group-wrapper">
        <div className="overlap-group">
          <img className="bibimbap-love-and" alt="Bibimbap love and" src="bibimbap-love-and-lemons-1.png" />
          <img className="rectangle" alt="Rectangle" src="rectangle-1.png" />
          <div className="text-wrapper">Ayo Memasak Makanan Enak!</div>
          <p className="p">Jelajahi aplikasi ini dan mulai memasak makanan yang lezat!</p>
          <img className="img" alt="Rectangle" src="rectangle-2.png" />
          <div className="div">Get Started !</div>
          <img className="group" alt="Group" src="group-1.png" />
        </div>
      </div>
    </div>
  );
};


const Home = () => {
  return (
    <div className={styles['frame']}>
      <div>
        <img
          src={bg}
          alt="rectangle"
          width={390}
          height={844}
          className={styles['rectangle']}
        />
        <img
          src={fontstyle}
          alt="rectangle"
          width={390}
          height={252}
          className={styles['rectangle1']}
        />
      </div>
      <div className={styles['kotak']}>
        <img
          src={rectangle1}
          alt="frame"
          width={100}
          height={150}
          className={styles['rectangle3']}
        />
        <div className={styles['alltext']}>
          <div className={styles['text']}>
            <p className={styles['text1']}>Ayo Memasak Makanan Enak!</p>
          </div>
          <div className={styles['text2']}>
            <p className={styles['text3']}>
              Jelajahi aplikasi ini dan mulai memasak makanan yang lezat!
            </p>
          </div>
        </div>
        <div className={styles['button']}>
          <p className={styles['text5']}>Get Started !</p>
          <img src={rectangle2}
            alt="rectangle"
            width={319}
            height={51}
            className={styles['rectangle2']} />
        </div>
      </div>
    </div>
  )
}

export default Home

